import React from "react";
import { BrowserRouter as Router, withRouter } from 'react-router-dom';
import { Nav, NavItem } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Nav id="navigation" as="ul" className="navbar navbar-inverse menu-background sht-navbar">
        <NavItem title="Home"></NavItem>
      </Nav>
    )
  }
} 

export default withRouter(CommunicatorNavigation);
